CREATE TABLE public.aree_meteo (
    id_area_meteo character varying(6) NOT NULL,
    id_area integer NOT NULL,
    descrizione character varying(60),
    top_y integer NOT NULL,
    left_x integer NOT NULL,
    primary key (id_area_meteo)
);

COMMENT ON TABLE public.aree_meteo IS 'Anagrafica delle aree meteorologiche';


CREATE TABLE public.regione_official (
    codice_istat_reg character varying(2) NOT NULL,
    denominazione character varying(40) NOT NULL,
    superficie integer,
    data_agg timestamp without time zone DEFAULT ('now'::text)::timestamp(6) with time zone NOT NULL,
    primary key (codice_istat_reg)
);


CREATE TABLE public.comune_official (
    id_comune serial NOT NULL,
    codice_regione character varying(2) NOT NULL,
    codice_provincia character varying(3) NOT NULL,
    codice_comune character varying(6) NOT NULL,
    codice_comune_old character varying(6),
    denominazione character varying(40) NOT NULL,
    latitudine_n numeric(10,8),
    longitudine_e numeric(10,8),
    x_wgs84 numeric(7,0),
    y_wgs84 numeric(7,0),
    quota_comune integer NOT NULL,
    rank integer,
    last_update timestamp(0) without time zone DEFAULT now() NOT NULL,
    username character varying(30) DEFAULT "current_user"() NOT NULL,
    primary key (id_comune)
);

COMMENT ON TABLE public.comune_official IS 'Tabella ISTAT ufficiale dei Comuni italiani';

COMMENT ON COLUMN public.comune_official.codice_comune_old IS 'Primary-key della tabella Comune (vecchio codice Istat, non aggiornato, se il Comune era presente)';


SELECT pg_catalog.setval('public.comune_official_id_comune_seq', 1214, true);

ALTER TABLE ONLY public.comune_official
    ADD CONSTRAINT comune_official_codice_comune_key UNIQUE (codice_comune);

ALTER TABLE ONLY public.comune_official
    ADD CONSTRAINT comune_official_fkey001 FOREIGN KEY (codice_regione) REFERENCES public.regione_official(codice_istat_reg) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY public.comune_official
    ADD CONSTRAINT comune_official_fkey002 FOREIGN KEY (codice_provincia) REFERENCES public.provincia(codice_istat_prov) ON UPDATE CASCADE ON DELETE CASCADE;

CREATE TABLE public.rel_aree_meteo_comune (
    id_area_meteo character varying(6) NOT NULL,
    id_comune integer NOT NULL,
    primary key (id_area_meteo, id_comune)
);

COMMENT ON TABLE public.rel_aree_meteo_comune IS 'Tabella di relazione tra le aree meteorologiche e i Comuni';


ALTER TABLE ONLY public.rel_aree_meteo_comune
    ADD CONSTRAINT rel_aree_meteo_comune_fkey001 FOREIGN KEY (id_area_meteo) REFERENCES public.aree_meteo(id_area_meteo) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY public.rel_aree_meteo_comune
    ADD CONSTRAINT rel_aree_meteo_comune_fkey002 FOREIGN KEY (id_comune) REFERENCES public.comune_official(id_comune) ON UPDATE CASCADE ON DELETE CASCADE;

CREATE TABLE public.stazioni_rappresentative_comune (
    id_comune integer NOT NULL,
    cod_staz_meteo_terma character varying(5) NOT NULL,
    cod_staz_meteo_igro character varying(5) NOT NULL,
    cod_staz_meteo_velv character varying(5) NOT NULL,
    primary key (id_comune)
);

COMMENT ON TABLE public.stazioni_rappresentative_comune IS 'Stazioni Terma, Igro e Velv rappresentative per ogni Comune';


ALTER TABLE ONLY public.stazioni_rappresentative_comune
    ADD CONSTRAINT stazioni_rappresentative_comune_fkey001 FOREIGN KEY (id_comune) REFERENCES public.comune_official(id_comune) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE ONLY public.stazioni_rappresentative_comune
    ADD CONSTRAINT stazioni_rappresentative_comune_fkey002 FOREIGN KEY (cod_staz_meteo_terma) REFERENCES public.stazione_misura(cod_staz_meteo) ON UPDATE CASCADE;

ALTER TABLE ONLY public.stazioni_rappresentative_comune
    ADD CONSTRAINT stazioni_rappresentative_comune_fkey003 FOREIGN KEY (cod_staz_meteo_igro) REFERENCES public.stazione_misura(cod_staz_meteo) ON UPDATE CASCADE;

ALTER TABLE ONLY public.stazioni_rappresentative_comune
    ADD CONSTRAINT stazioni_rappresentative_comune_fkey004 FOREIGN KEY (cod_staz_meteo_velv) REFERENCES public.stazione_misura(cod_staz_meteo) ON UPDATE CASCADE;

CREATE TABLE public.weather_query (
    id_query bigserial NOT NULL,
    parametro character varying(10),
    sql_text text,
    description character varying(100),
    primary key (id_query)
);

FROM meteo_real_time
   LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
      AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com,
   (SELECT
      (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
      (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
WHERE meteo_real_time.id_parametro = ''TERMA''
   AND meteo_real_time.id_aggregazione = ''0''
   -- AND meteo_real_time.tipologia_validaz = ''OK''
   AND meteo_real_time.flag_validaz_autom = ''0''
   AND stazione_misura.cod_staz_meteo = ''#cod_staz_meteo#''
   AND (meteo_real_time.data + meteo_real_time.ora) BETWEEN start_time AND end_time', 'Real Time: Temperatura massima su stazione');
         WHEN (fore_value NOT IN (''0'', ''1'', ''2'', ''3'')) THEN ''4''
         ELSE fore_value
         END)::NUMERIC AS value, (model_name || '' '' || date_emiss || '' '' || time_emiss)::VARCHAR AS source
FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, MAX(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE forecast_runs.model_name = ''LAMIN0063''
      AND forecast_runs.model_type = ''DMO''
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''CT''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC, time_emiss DESC
LIMIT 1', 'Forecast: Cloud Type massimo su stazione, modello Lamin');
FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, AVG(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type) IN ((''MULTMODEL'', ''DMO''), (''ECMWF0200'', ''DMO''), (''LAMIN0063'', ''DMO''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''IGRO''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC,
  CASE
    WHEN (model_name, model_type) = (''MULTMODEL'', ''DMO'') THEN 1
    WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 2
    WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 3
  END ASC,
  time_emiss DESC
LIMIT 1', 'Forecast: Umidit media su stazione, con scelta in cascata su Multimodel, Ecmwf e Lamin');
       ''Realtime''::VARCHAR AS source
FROM
   (SELECT SUM(meteo_real_time.valore_validato) AS valore
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
   WHERE (meteo_real_time.id_parametro, meteo_real_time.id_aggregazione) IN
         ((''PLUV'', ''193''), (''PLUV_15M'', ''381''), (''PLUV_30M'', ''343''))
      AND meteo_real_time.flag_validaz_autom = ''0''
      AND comune.codice_istat_prov = ''#cod_staz_meteo#''
      AND stazione_misura.cod_staz_meteo != ''90815''
      AND (meteo_real_time.data + meteo_real_time.ora) > start_time
      AND (meteo_real_time.data + meteo_real_time.ora) <= end_time
   GROUP BY stazione_misura.cod_staz_meteo) AS mrt', 'Real Time: Precipitazione media su Provincia');
FROM
   (SELECT MAX(meteo_real_time.valore_validato) AS tmax_stazione
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE meteo_real_time.id_parametro = ''TERMA''
      AND meteo_real_time.id_aggregazione = ''0''
      AND meteo_real_time.tipologia_validaz = ''OK''
      AND stazione_misura.quota_stazione BETWEEN 0 AND 700
      AND comune.codice_istat_prov IN (''001'', ''002'', ''003'', ''004'', ''005'', ''006'', ''096'', ''103'')
      AND (meteo_real_time.data + meteo_real_time.ora) BETWEEN start_time AND end_time
   GROUP BY stazione_misura.cod_staz_meteo) AS mrt', 'Real Time: Media temperature massime delle stazioni del Piemonte tra 0 e 700 metri di quota');
FROM (
   SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, AVG(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type) IN ((''ECMWF0200'', ''DMO''), (''LAMIN0063'', ''DMO''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''ZERO''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss
   
   UNION ALL
   
   SELECT forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE AS date_emiss, forecast_zone.data_emissione::TIME AS time_emiss, AVG(forecast_zone.valore_originale) AS fore_value
   FROM forecast_zone
      LEFT JOIN stazione_misura_all ON forecast_zone.id_allertamento = stazione_misura_all.idtab_allertamento_2,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
   WHERE (forecast_zone.model_name, forecast_zone.model_type) = (''PSA_00_DO'', ''DMO'')
      AND forecast_zone.data_emissione::DATE = current_date
      AND stazione_misura_all.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_zone.id_parametro = ''FRZLVL''
      AND forecast_zone.id_aggregazione = ''0''
      AND forecast_zone.data_riferimento BETWEEN start_time AND end_time
   GROUP BY forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE, forecast_zone.data_emissione::TIME
   ) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC,
  CASE
    WHEN (model_name, model_type) = (''PSA_00_DO'', ''DMO'') THEN 1
    WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 2
    WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 3
  END ASC,
  time_emiss DESC
LIMIT 1', 'Forecast: Zero termico medio su stazione, con scelta in cascata su PSA, Ecmwf e Lamin');
FROM (
   SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, SUM(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type, forecast_parameters.id_aggregazione) IN ((''ECMWF0200'', ''DMO'', ''326''), (''LAMIN0063'', ''DMO'', ''192''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''PLUV''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss
   
   UNION ALL
   
   SELECT forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE AS date_emiss, forecast_zone.data_emissione::TIME AS time_emiss, SUM(forecast_zone.valore_originale) AS fore_value
   FROM forecast_zone
      LEFT JOIN stazione_misura_all ON (forecast_zone.id_allertamento = stazione_misura_all.idtab_allertamento_2),
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
   WHERE (forecast_zone.model_name, forecast_zone.model_type) = (''PSA_00_DO'', ''DMO'')
      AND forecast_zone.data_emissione::DATE = current_date
      AND stazione_misura_all.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_zone.id_parametro = ''PLUV''
      AND forecast_zone.id_aggregazione = ''900''
      AND forecast_zone.data_riferimento BETWEEN start_time AND end_time
   GROUP BY forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE, forecast_zone.data_emissione::TIME
   ) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC,
  CASE
    WHEN (model_name, model_type) = (''PSA_00_DO'', ''DMO'') THEN 1
    WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 2
    WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 3
  END ASC,
  time_emiss DESC
LIMIT 1', 'Forecast: Precipitazioni cumulate su stazione, con scelta in cascata su PSA, Ecmwf e Lamin');
FROM
   (SELECT model_name, model_type, date_emiss, time_emiss, AVG(terma_value) AS terma, AVG(igro_value) AS igro
   FROM
      (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, forecast_parameters.id_parametro,
      CASE WHEN forecast_parameters.id_parametro = ''TERMA'' THEN AVG(forecast_values.value)
           ELSE null
           END AS terma_value,
      CASE WHEN forecast_parameters.id_parametro = ''IGRO'' THEN AVG(forecast_values.value)
           ELSE null
           END AS igro_value
      FROM forecast_runs
         LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
         LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
         LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
         (SELECT
            (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
            (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
      WHERE forecast_runs.model_name = ''MULTMODEL''
         AND forecast_runs.model_type = ''DMO''
         AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
         AND forecast_parameters.id_parametro IN (''TERMA'', ''IGRO'')
         AND forecast_parameters.id_aggregazione = ''0''
         AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
      GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, forecast_parameters.id_parametro) AS datatable
   GROUP BY model_name, model_type, date_emiss, time_emiss
   ORDER BY date_emiss DESC, time_emiss DESC) AS rugiadatable
WHERE terma IS NOT NULL
   AND igro IS NOT NULL
LIMIT 1', 'Forecast: Temperatura del punto di ruguada su stazione, modello Multimodel');
FROM
   (SELECT MAX(meteo_real_time.valore_validato) AS tmax_stazione
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE meteo_real_time.id_parametro = ''TERMA''
      AND meteo_real_time.id_aggregazione = ''0''
      AND meteo_real_time.tipologia_validaz = ''OK''
      AND stazione_misura.quota_stazione BETWEEN 1400 AND 1600
      AND comune.codice_istat_prov IN (''001'', ''002'', ''003'', ''004'', ''005'', ''006'', ''096'', ''103'')
      AND (meteo_real_time.data + meteo_real_time.ora) BETWEEN start_time AND end_time
   GROUP BY stazione_misura.cod_staz_meteo) AS mrt', 'Real Time: Media temperature massime delle stazioni del Piemonte tra 1400 e 1600 metri di quota');
FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, AVG(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE forecast_runs.model_name = ''ECMWF0200''
      AND forecast_runs.model_type = ''DMO''
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''COP_TOT''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC, time_emiss DESC
LIMIT 1', 'Forecast: Copertura nuvolosa media su stazione, modello Ecmwf');
FROM
   (SELECT MAX(meteo_real_time.valore_validato) AS tmax_stazione
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
