      /* La quota neve NON e'' minore della quota stazione, quindi piove */
         (SELECT CASE WHEN (pluv_value <= 5) THEN ''1''
            WHEN (pluv_value >  5 AND pluv_value <= 15) THEN ''2''
            WHEN (pluv_value > 15 AND pluv_value <= 30) THEN ''3''
            WHEN (pluv_value > 30) THEN ''4''
         ELSE null
