            WHEN (pluv_value > 30 AND pluv_value <= 50) THEN ''3''
            WHEN (pluv_value > 50) THEN ''4''
         ELSE null
         END)
      ELSE
      /* La quota neve NON e'' minore della quota stazione, quindi piove */
         (SELECT CASE WHEN (pluv_value <= 10) THEN ''1''
            WHEN (pluv_value > 10 AND pluv_value <= 30) THEN ''2''
            WHEN (pluv_value > 30 AND pluv_value <= 60) THEN ''3''
            WHEN (pluv_value > 60) THEN ''4''
         ELSE null
         END)
      END)
   WHEN (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) - (''#start_date#''::DATE + ''#start_time#''::TIME) = INTERVAL ''24 hours'' THEN
   /* L''intervallo e'' di 24 ore */
      (SELECT CASE WHEN snow_value <= (SELECT quota_stazione FROM stazione_misura_all WHERE cod_staz_meteo = ''#cod_staz_meteo#'') THEN
      /* La quota neve e'' minore della quota stazione, quindi nevica */
         (SELECT CASE WHEN (pluv_value <= 15) THEN ''1''
            WHEN (pluv_value > 15 AND pluv_value <= 40) THEN ''2''
            WHEN (pluv_value > 40 AND pluv_value <= 70) THEN ''3''
            WHEN (pluv_value > 70) THEN ''4''
         ELSE null
         END)
      ELSE
      /* La quota neve NON e'' minore della quota stazione, quindi piove */
         (SELECT CASE WHEN (pluv_value <= 15) THEN ''1''
            WHEN (pluv_value > 15 AND pluv_value <= 45) THEN ''2''
            WHEN (pluv_value > 45 AND pluv_value <= 90) THEN ''3''
