FROM (
   SELECT model_name, model_type, date_emiss, time_emiss, SUM(pluv_value) AS pluv_value, AVG(snow_value) AS snow_value
   FROM (
      SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, SUM(forecast_values.value) AS pluv_value, null AS snow_value
      FROM forecast_runs
         LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
         LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
         LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
         (SELECT
            (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
            (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
      WHERE (forecast_runs.model_name, forecast_runs.model_type, forecast_parameters.id_aggregazione) IN ((''ECMWF0200'', ''DMO'', ''326''), (''LAMIN0063'', ''DMO'', ''192''))
         AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
         AND forecast_parameters.id_parametro = ''PLUV''
         AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
      GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss

      UNION ALL

      SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, null AS pluv_value, AVG(forecast_values.value) AS snow_value
      FROM forecast_runs
         LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
         LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
         LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
         (SELECT
            (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
            (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
      WHERE (forecast_runs.model_name, forecast_runs.model_type, forecast_parameters.id_aggregazione) IN ((''ECMWF0200'', ''DMO'', ''0''), (''LAMIN0063'', ''DMO'', ''0''))
         AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
         AND forecast_parameters.id_parametro = ''SNOW_LEV''
         AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
      GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss

      UNION ALL

      SELECT forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE AS date_emiss, forecast_zone.data_emissione::TIME AS time_emiss, SUM(forecast_zone.valore_originale) AS pluv_value, null AS snow_value
      FROM forecast_zone
         LEFT JOIN stazione_misura_all ON forecast_zone.id_allertamento = stazione_misura_all.idtab_allertamento_2,
         (SELECT
            (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
            (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
      WHERE (forecast_zone.model_name, forecast_zone.model_type) = (''PSA_00_DO'', ''DMO'')
         AND forecast_zone.data_emissione::DATE = current_date
         AND stazione_misura_all.cod_staz_meteo = ''#cod_staz_meteo#''
         AND forecast_zone.id_parametro = ''PLUV''
         AND forecast_zone.id_aggregazione = ''900''
         AND forecast_zone.data_riferimento BETWEEN start_time AND end_time
      GROUP BY forecast_zone.model_name, forecast_zone.model_type, forecast_zone.data_emissione::DATE, forecast_zone.data_emissione::TIME

      UNION ALL

      SELECT model_name, model_type, date_emiss, time_emiss, null AS pluv_value,
      CASE
         WHEN (snow_value IS NULL AND (frzlvl_value - 300) >= 0) THEN (frzlvl_value - 300)
         WHEN (snow_value IS NULL AND (frzlvl_value - 300) <  0) THEN 0
         ELSE snow_value
         END AS snow_value
      FROM
         (SELECT snow_table.model_name, snow_table.model_type, snow_table.data_emissione::DATE AS date_emiss, snow_table.data_emissione::TIME AS time_emiss,
            AVG(snow_table.valore_originale) AS snow_value, AVG(frzlvl_table.valore_originale) AS frzlvl_value
         FROM forecast_zone AS snow_table LEFT JOIN forecast_zone AS frzlvl_table ON
            (snow_table.model_name = frzlvl_table.model_name AND
            snow_table.model_type = frzlvl_table.model_type AND
            snow_table.data_emissione = frzlvl_table.data_emissione AND
            snow_table.id_allertamento = frzlvl_table.id_allertamento),
            (SELECT idtab_allertamento_2 FROM stazione_misura_all WHERE cod_staz_meteo = ''#cod_staz_meteo#'') AS allertamento,
            (SELECT
               (''#start_date#''::DATE + ''#start_time#''::TIME + ''00:00:01''::TIME) AS start_time,
               (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
         WHERE  (snow_table.model_name, snow_table.model_type) = (''PSA_00_DO'', ''DMO'')
            AND snow_table.data_emissione::DATE = current_date
            AND snow_table.id_allertamento = idtab_allertamento_2
            AND snow_table.id_parametro = ''SNOW_LEV''
            AND snow_table.id_aggregazione = ''0''
            AND snow_table.data_riferimento BETWEEN start_time AND end_time
            AND frzlvl_table.id_parametro = ''FRZLVL''
            AND frzlvl_table.id_aggregazione = ''0''
            AND frzlvl_table.data_riferimento BETWEEN start_time AND end_time
         GROUP BY snow_table.model_name, snow_table.model_type, snow_table.data_emissione::DATE, snow_table.data_emissione::TIME) as psa
      ) AS datatable
   GROUP BY model_name, model_type, date_emiss, time_emiss
   HAVING SUM(pluv_value) IS NOT NULL AND AVG(snow_value) IS NOT NULL
   ORDER BY date_emiss DESC,
     CASE
       WHEN (model_name, model_type) = (''PSA_00_DO'', ''DMO'') THEN 1
       WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 2
       WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 3
     END ASC,
     time_emiss DESC
   LIMIT 1
) AS megatable', 'Forecast: Prec. in classi (6, 12 o 24 ore) su stazione, con scelta in cascata su PSA, Ecmwf e Lamin');
         WHEN (fore_value >=  0   AND fore_value <  0.3) THEN ''0''
