FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, AVG(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type) IN ((''MULTMODEL'', ''DMO''), (''ECMWF0200'', ''DMO''), (''LAMIN0063'', ''DMO''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''VELV''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss) AS datatable
WHERE fore_value IS NOT NULL
ORDER BY date_emiss DESC,
