    WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 1
    WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 3
  END ASC,
  time_emiss DESC
LIMIT 1', 'Forecast: Vento in classi Beaufort su stazione, con scelta in cascata su Multimodel, Lamin e Ecmwf');
       CASE WHEN ROUND(valore, 1) = 0 THEN NULL ELSE testo::VARCHAR END AS value_text,
       ''Realtime''::VARCHAR AS source
FROM
   (SELECT SUM(meteo_real_time.valore_validato) AS valore, stazione_misura.cod_staz_meteo AS testo
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME + ''00:00:01''::TIME) AS end_time) AS timetable
   WHERE (meteo_real_time.id_parametro, meteo_real_time.id_aggregazione) IN
         ((''PLUV'', ''193''), (''PLUV_15M'', ''381''), (''PLUV_30M'', ''343''))
      AND meteo_real_time.flag_validaz_autom = ''0''
      AND comune.codice_istat_prov = ''#cod_staz_meteo#''
      AND stazione_misura.cod_staz_meteo != ''90815''
      AND (meteo_real_time.data + meteo_real_time.ora) > start_time
      AND (meteo_real_time.data + meteo_real_time.ora) <= end_time
   GROUP BY stazione_misura.cod_staz_meteo
   HAVING SUM(meteo_real_time.valore_validato) > 0.2
   UNION
   SELECT 0 AS valore, null AS testo) AS mrt
ORDER BY valore DESC
LIMIT 1', 'Real Time: Precipitazione massima su Provincia');
       CASE WHEN ROUND(valore, 1) = 0 THEN NULL ELSE testo::VARCHAR END AS value_text,
       ''Realtime''::VARCHAR AS source
FROM
   (SELECT SUM(meteo_real_time.valore_validato) AS valore, stazione_misura.cod_staz_meteo AS testo, start_time, end_time
   FROM meteo_real_time
      LEFT JOIN stazione_misura ON meteo_real_time.codice_istat_comune = stazione_misura.codice_istat_comune
         AND meteo_real_time.progr_punto_com = stazione_misura.progr_punto_com
      LEFT JOIN comune ON stazione_misura.codice_istat_comune = comune.codice_istat_comune,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) + (serie || '' minutes'')::INTERVAL AS start_time,
         (''#start_date#''::DATE + ''#start_time#''::TIME) + (serie || '' minutes'')::INTERVAL + (''3 hours'')::INTERVAL AS end_time
      FROM generate_series(0, 540, 10) AS serie) AS timetable
   WHERE (meteo_real_time.id_parametro, meteo_real_time.id_aggregazione) IN
         ((''PLUV'', ''193''), (''PLUV_15M'', ''381''), (''PLUV_30M'', ''343''))
      AND meteo_real_time.flag_validaz_autom = ''0''
      AND comune.codice_istat_prov = ''#cod_staz_meteo#''
      AND stazione_misura.cod_staz_meteo != ''90815''
      AND (meteo_real_time.data + meteo_real_time.ora) > start_time
      AND (meteo_real_time.data + meteo_real_time.ora) <= end_time
   GROUP BY stazione_misura.cod_staz_meteo, start_time, end_time
   HAVING SUM(meteo_real_time.valore_validato) > 20
   UNION
   SELECT 0 AS valore, null AS testo, null AS start_time, null AS end_time) AS mrt
ORDER BY valore DESC
LIMIT 1', 'Real Time: Precipitazione massima in 3 ore (periodo di 12 ore) su Provincia (solo >20mm)');
FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss,
      CASE
         WHEN forecast_values.value >=   0   AND forecast_values.value <  22.5 THEN ''N''
         WHEN forecast_values.value >=  22.5 AND forecast_values.value <  67.5 THEN ''NE''
         WHEN forecast_values.value >=  67.5 AND forecast_values.value < 112.5 THEN ''E''
         WHEN forecast_values.value >= 112.5 AND forecast_values.value < 157.5 THEN ''SE''
         WHEN forecast_values.value >= 157.5 AND forecast_values.value < 202.5 THEN ''S''
         WHEN forecast_values.value >= 202.5 AND forecast_values.value < 247.5 THEN ''SW''
         WHEN forecast_values.value >= 247.5 AND forecast_values.value < 292.5 THEN ''W''
         WHEN forecast_values.value >= 292.5 AND forecast_values.value < 337.5 THEN ''NW''
         WHEN forecast_values.value >= 337.5 AND forecast_values.value < 360   THEN ''N''
      ELSE ''VR''
      END AS wind_direction
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type) IN ((''MULTMODEL'', ''DMO''), (''ECMWF0200'', ''DMO''), (''LAMIN0063'', ''DMO''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''DIRV''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time) AS datatable
GROUP BY model_name, model_type, date_emiss, time_emiss, wind_direction
ORDER BY date_emiss DESC,
  CASE
    WHEN (model_name, model_type) = (''MULTMODEL'', ''DMO'') THEN 3
    WHEN (model_name, model_type) = (''LAMIN0063'', ''DMO'') THEN 1
    WHEN (model_name, model_type) = (''ECMWF0200'', ''DMO'') THEN 2
  END ASC,
  time_emiss DESC,
  COUNT(wind_direction) DESC
LIMIT 1', 'Forecast: Direzione vento prevalente su stazione, con scelta in cascata su Multimodel, Lamin e Ecmwf');
FROM
   (SELECT forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss, AVG(forecast_values.value) AS fore_value
   FROM forecast_runs
      LEFT JOIN forecast_stations ON forecast_runs.id_forecast_run = forecast_stations.id_forecast_run
      LEFT JOIN forecast_parameters ON forecast_stations.id_forecast_station = forecast_parameters.id_forecast_station
      LEFT JOIN forecast_values ON forecast_parameters.id_forecast_parameter = forecast_values.id_forecast_parameter,
      (SELECT
         (''#start_date#''::DATE + ''#start_time#''::TIME) AS start_time,
         (''#end_date#''::DATE + ''#end_time#''::TIME) AS end_time) AS timetable
   WHERE (forecast_runs.model_name, forecast_runs.model_type) IN ((''MULTMODEL'', ''DMO''), (''ECMWF0200'', ''DMO''), (''LAMIN0063'', ''DMO''))
      AND forecast_stations.cod_staz_meteo = ''#cod_staz_meteo#''
      AND forecast_parameters.id_parametro = ''VELV''
      AND forecast_parameters.id_aggregazione = ''0''
      AND (forecast_values.date_rif + forecast_values.time_rif) BETWEEN start_time AND end_time
   GROUP BY forecast_runs.model_name, forecast_runs.model_type, forecast_runs.date_emiss, forecast_runs.time_emiss) AS datatable
WHERE fore_value IS NOT NULL
