CREATE OR REPLACE FUNCTION public.refresh_forecast_comuni()
 RETURNS void
 LANGUAGE plpgsql
AS $function$
DECLARE
  query_tmax CONSTANT INTEGER := 1;
  query_tmin CONSTANT INTEGER := 2;
  query_igro CONSTANT INTEGER := 39;
  query_velv CONSTANT INTEGER := 6;
  query_dirv CONSTANT INTEGER := 48;
  time_array CONSTANT INTEGER ARRAY[8] := '{48, 64, 65, 81, 82, 98, 99}';
  pioggia_array CONSTANT INTEGER ARRAY[8] := '{27, 8, 17, 6, 25, 20, 23, 24, 18, 28, 9, 21, 7, 26, 31, 1, 30}';
  my_time_layouts INTEGER;
  my_sky_condition SMALLINT;
  my_record_aree RECORD;
  my_record_aree_comune RECORD;
  my_record_comune RECORD;
  my_record_comune_terma RECORD;
  my_record_comune_igro RECORD;
  my_record_comune_velv RECORD;
  my_record_sky_condition RECORD;
  my_record_snow_level RECORD;
  my_record_stazione RECORD;
  my_record_timestamp RECORD;
  my_record_weather RECORD;
  my_weather_result RECORD;
  my_record_w35 RECORD;
BEGIN

/*Cerco l'id dell'ultimo w35 disponibile*/
select * into my_record_w35 from w35 where status='1' order by last_update desc limit 1;
IF my_record_w35.data_emissione = current_date THEN
	raise notice 'Ok ho trovato il record di oggi, id ultimo w35: "%"', my_record_w35.id_w35;
	
	FOREACH my_time_layouts IN ARRAY time_array
	LOOP
	   /* Generazione Timestamp/Date/Time */
	   SELECT INTO my_record_timestamp
	      current_date + time_layouts.start_day_offset + time_layouts.start_time AS start_ts,
	      current_date + time_layouts.start_day_offset AS start_d,
	      time_layouts.start_time AS start_t,
	      current_date + time_layouts.end_day_offset + time_layouts.end_time AS end_ts,
	      current_date + time_layouts.end_day_offset AS end_d,
	      time_layouts.end_time AS end_t
	   FROM time_layouts
	   WHERE id_time_layouts = my_time_layouts;
	   
	   /* Generazione record di previsione per ogni Comune e relativi id_time_layouts per la data corrente */
	   FOR my_record_comune IN
	      (SELECT id_comune
	      FROM stazioni_rappresentative_comune)
	   LOOP
	      IF EXISTS (SELECT 1 FROM forecast_comuni WHERE id_comune = my_record_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts) THEN
	         UPDATE forecast_comuni SET start_time = my_record_timestamp.start_ts, end_time = my_record_timestamp.end_ts, last_update = current_timestamp WHERE id_comune = my_record_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	      ELSE
	      END IF;
	   END LOOP;
	   
	   /* Aggiornamento Temperature */
	   FOR my_record_stazione IN
	      (SELECT DISTINCT cod_staz_meteo_terma
	      FROM stazioni_rappresentative_comune)
	   LOOP
	      IF my_time_layouts = ANY('{64, 81, 98}'::INTEGER[]) THEN
	         /* Minime */
	         SELECT INTO my_record_weather
	            REPLACE (REPLACE (REPLACE (REPLACE (REPLACE (sql_text,
	                '#cod_staz_meteo#', my_record_stazione.cod_staz_meteo_terma),
	                '#start_date#', my_record_timestamp.start_d::TEXT),
	                '#start_time#', my_record_timestamp.start_t::TEXT),
	                '#end_date#', my_record_timestamp.end_d::TEXT),
	                '#end_time#', my_record_timestamp.end_t::TEXT
	                ) AS sql
	         FROM weather_query
	         WHERE id_query = query_tmin;
	      ELSE
	         /* Massime */
	         SELECT INTO my_record_weather
	            REPLACE (REPLACE (REPLACE (REPLACE (REPLACE (sql_text,
	                '#cod_staz_meteo#', my_record_stazione.cod_staz_meteo_terma),
	                '#start_date#', my_record_timestamp.start_d::TEXT),
	                '#start_time#', my_record_timestamp.start_t::TEXT),
	                '#end_date#', my_record_timestamp.end_d::TEXT),
	                '#end_time#', my_record_timestamp.end_t::TEXT
	                ) AS sql
	         FROM weather_query
	         WHERE id_query = query_tmax;
	      END IF;
	      /* raise notice 'sql terma: "%"', my_record_weather.sql; */
	
	      EXECUTE my_record_weather.sql INTO my_weather_result;
	
	      /* Aggiorna tutti i Comuni associati alla stazione TERMA */
	      FOR my_record_comune_terma IN
	         (SELECT id_comune
	         FROM stazioni_rappresentative_comune
	         WHERE cod_staz_meteo_terma = my_record_stazione.cod_staz_meteo_terma)
	      LOOP
	         UPDATE forecast_comuni SET air_temperature = my_weather_result.value, last_update = current_timestamp WHERE id_comune = my_record_comune_terma.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	      END LOOP;
	   END LOOP;
	   
	   /* Aggiornamento Umidita' */
	   FOR my_record_stazione IN
	      (SELECT DISTINCT cod_staz_meteo_igro
	      FROM stazioni_rappresentative_comune)
	   LOOP
	      SELECT INTO my_record_weather
	         REPLACE (REPLACE (REPLACE (REPLACE (REPLACE (sql_text,
	            '#cod_staz_meteo#', my_record_stazione.cod_staz_meteo_igro),
	            '#start_date#', my_record_timestamp.start_d::TEXT),
	            '#start_time#', my_record_timestamp.start_t::TEXT),
	            '#end_date#', my_record_timestamp.end_d::TEXT),
	            '#end_time#', my_record_timestamp.end_t::TEXT
	            ) AS sql
	      FROM weather_query
	      WHERE id_query = query_igro;
	
	      /* raise notice 'sql igro: "%"', my_record_weather.sql; */
	      EXECUTE my_record_weather.sql INTO my_weather_result;
	
	      /* Aggiorna tutti i Comuni associati alla stazione IGRO */
	      FOR my_record_comune_igro IN
	         (SELECT id_comune
	         FROM stazioni_rappresentative_comune
	         WHERE cod_staz_meteo_igro = my_record_stazione.cod_staz_meteo_igro)
	      LOOP
	         UPDATE forecast_comuni SET humidity = my_weather_result.value, last_update = current_timestamp WHERE id_comune = my_record_comune_igro.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	      END LOOP;
	   END LOOP;
	   
	   /* Aggiornamento Vento */
	   FOR my_record_stazione IN
	      (SELECT DISTINCT cod_staz_meteo_velv
	      FROM stazioni_rappresentative_comune)
	   LOOP
	      /* Velocita' vento */
	      SELECT INTO my_record_weather
	         REPLACE (REPLACE (REPLACE (REPLACE (REPLACE (sql_text,
	            '#cod_staz_meteo#', my_record_stazione.cod_staz_meteo_velv),
	            '#start_date#', my_record_timestamp.start_d::TEXT),
	            '#start_time#', my_record_timestamp.start_t::TEXT),
	            '#end_date#', my_record_timestamp.end_d::TEXT),
	            '#end_time#', my_record_timestamp.end_t::TEXT
	            ) AS sql
	      FROM weather_query
	      WHERE id_query = query_velv;
	
	      /* raise notice 'sql vento: "%"', my_record_weather.sql; */
	      EXECUTE my_record_weather.sql INTO my_weather_result;
	
	      /* Aggiorna tutti i Comuni associati alla stazione VELV */
	      FOR my_record_comune_velv IN
	         (SELECT id_comune
	         FROM stazioni_rappresentative_comune
	         WHERE cod_staz_meteo_velv = my_record_stazione.cod_staz_meteo_velv)
	      LOOP
	         UPDATE forecast_comuni SET wind_class = my_weather_result.value, last_update = current_timestamp WHERE id_comune = my_record_comune_velv.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	      END LOOP;
	
	      /* Direzione vento */
	      SELECT INTO my_record_weather
	         REPLACE (REPLACE (REPLACE (REPLACE (REPLACE (sql_text,
	            '#cod_staz_meteo#', my_record_stazione.cod_staz_meteo_velv),
	            '#start_date#', my_record_timestamp.start_d::TEXT),
	            '#start_time#', my_record_timestamp.start_t::TEXT),
	            '#end_date#', my_record_timestamp.end_d::TEXT),
	            '#end_time#', my_record_timestamp.end_t::TEXT
	            ) AS sql
	      FROM weather_query
	      WHERE id_query = query_dirv;
	
	      /* raise notice 'sql dirv: "%"', my_record_weather.sql; */
	      EXECUTE my_record_weather.sql INTO my_weather_result;
	
	      /* Aggiorna tutti i Comuni associati alla stazione VELV */
	      FOR my_record_comune_velv IN
	         (SELECT id_comune
	         FROM stazioni_rappresentative_comune
	         WHERE cod_staz_meteo_velv = my_record_stazione.cod_staz_meteo_velv)
	      LOOP
	         UPDATE forecast_comuni SET wind_direction = my_weather_result.value_text, last_update = current_timestamp WHERE id_comune = 
            my_record_comune_velv.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	      END LOOP;
	   END LOOP;
	   /* Aggiornamento SNOW LEVEL Su Comuni */
	   FOR my_record_aree IN
	(SELECT id_area_meteo
	  FROM aree_meteo)
	   LOOP
	/*Cerco snow level su w35*/
	     SELECT INTO my_record_weather  
	(CASE WHEN w35_data.numeric_value IS NOT NULL THEN
	   w35_data.numeric_value
	 ELSE
	   w35_data.numeric_value
	END) AS value,('Aree_Meteo'||my_record_w35.data_emissione)::VARCHAR as source
	FROM w35_data
	     WHERE w35_data.id_area_meteo=my_record_aree.id_area_meteo
	     AND w35_data.id_time_layouts=my_time_layouts
	     AND w35_data.id_parametro='SNOW_LEV'
	     AND w35_data.id_aggregazione='0'
	     AND w35_data.id_w35=my_record_w35.id_w35
	     AND (w35_data.numeric_value IS NOT NULL OR w35_data.numeric_value IS NOT NULL)
	     ORDER BY my_record_w35.data_emissione DESC
	     LIMIT 1;
	     FOR my_record_aree_comune IN
	         (SELECT comune_official.id_comune, comune_official.quota_comune
	         FROM rel_aree_meteo_comune
	         LEFT JOIN comune_official ON rel_aree_meteo_comune.id_comune = comune_official.id_comune
	         WHERE rel_aree_meteo_comune.id_area_meteo = my_record_aree.id_area_meteo)
	     LOOP
            /* inserisci la quota neve solo in presenza di pioggia, neve o temporali */
            /* Cerco Sky Condition su w35 */
            SELECT INTO my_record_sky_condition (CASE WHEN w35_data.numeric_value IS NOT NULL THEN
               (CASE WHEN w35_data.numeric_value = 27 THEN 8
               WHEN w35_data.numeric_value = 28 THEN 9
               ELSE w35_data.numeric_value
               END)
            ELSE
               (CASE WHEN w35_data.numeric_value = 27 THEN 8
               WHEN w35_data.numeric_value = 28 THEN 9
               ELSE w35_data.numeric_value
               END)
            END) AS value, ('Aree_Meteo ' || my_record_w35.data_emissione)::VARCHAR AS source, 
               ignore_refresh_forecast_comuni, id_area_meteo, id_time_layouts
            FROM w35_data
            WHERE w35_data.id_area_meteo = my_record_aree.id_area_meteo
               AND w35_data.id_time_layouts = my_time_layouts
               AND w35_data.id_parametro = 'SKY_12'
               AND w35_data.id_aggregazione = '0'
               AND w35_data.id_w35=my_record_w35.id_w35
               AND ( w35_data.numeric_value IS NOT NULL OR w35_data.numeric_value IS NOT NULL 
            )
            ORDER BY my_record_w35.data_emissione DESC
            LIMIT 1;

            IF my_record_sky_condition.value = ANY(pioggia_array) THEN
               /* Siamo in presenza di precipitazioni (neve, pioggia, temporali, ecc.) */
               UPDATE forecast_comuni SET snow_level = my_record_weather.value, last_update=current_timestamp 
               WHERE id_comune=my_record_aree_comune.id_comune 
               AND data_emissione=current_date AND id_time_layouts=my_time_layouts;
            ELSE
               UPDATE forecast_comuni SET snow_level = null, last_update=current_timestamp 
               WHERE id_comune=my_record_aree_comune.id_comune 
               AND data_emissione=current_date AND id_time_layouts=my_time_layouts;
            END IF;
	     END LOOP;
	   END LOOP;
	   /* Aggiornamento FREEZING LEVEL Su Comuni */
	   FOR my_record_aree IN
	(SELECT id_area_meteo
	  FROM aree_meteo)
	   LOOP
	/*Cerco FREEZING level su w35*/
	     SELECT INTO my_record_weather  
	(CASE WHEN w35_data.numeric_value IS NOT NULL THEN
	   w35_data.numeric_value
	 ELSE
	   w35_data.numeric_value
	END) AS value,('Aree_Meteo'||my_record_w35.data_emissione)::VARCHAR as source
	FROM w35_data
	     WHERE w35_data.id_area_meteo=my_record_aree.id_area_meteo
	     AND w35_data.id_time_layouts=my_time_layouts
	     AND w35_data.id_parametro='ZERO'
	     AND w35_data.id_aggregazione='0'
	     AND w35_data.id_w35=my_record_w35.id_w35
	     AND (w35_data.numeric_value IS NOT NULL OR w35_data.numeric_value IS NOT NULL)
	     ORDER BY my_record_w35.data_emissione DESC
	     LIMIT 1;
	     FOR my_record_aree_comune IN
	         (SELECT comune_official.id_comune, comune_official.quota_comune
	         FROM rel_aree_meteo_comune
	         LEFT JOIN comune_official ON rel_aree_meteo_comune.id_comune = comune_official.id_comune
	         WHERE rel_aree_meteo_comune.id_area_meteo = my_record_aree.id_area_meteo)
	     LOOP
	       UPDATE forecast_comuni SET freezing_level = my_record_weather.value, last_update=current_timestamp 
	       WHERE id_comune=my_record_aree_comune.id_comune 
	       AND data_emissione=current_date AND id_time_layouts=my_time_layouts;
	     END LOOP;
	   END LOOP;
	   /* Aggiornamento Sky Condition su Comuni */
	   FOR my_record_aree IN
	      (SELECT id_area_meteo
	      FROM aree_meteo)
	   LOOP
	      /* Cerco Sky Condition su w35 */
	      SELECT INTO my_record_sky_condition (CASE WHEN w35_data.numeric_value IS NOT NULL THEN
	         (CASE WHEN w35_data.numeric_value = 27 THEN 8
	         WHEN w35_data.numeric_value = 28 THEN 9
	         ELSE w35_data.numeric_value
	         END)
	      ELSE
	         (CASE WHEN w35_data.numeric_value = 27 THEN 8
	         WHEN w35_data.numeric_value = 28 THEN 9
	         ELSE w35_data.numeric_value
	         END)
	      END) AS value, ('Aree_Meteo ' || my_record_w35.data_emissione)::VARCHAR AS source, 
	         ignore_refresh_forecast_comuni, id_area_meteo, id_time_layouts
	      FROM w35_data
	      WHERE w35_data.id_area_meteo = my_record_aree.id_area_meteo
	         AND w35_data.id_time_layouts = my_time_layouts
	         AND w35_data.id_parametro = 'SKY_12'
	         AND w35_data.id_aggregazione = '0'
	         AND w35_data.id_w35=my_record_w35.id_w35
	         AND ( w35_data.numeric_value IS NOT NULL OR w35_data.numeric_value IS NOT NULL )
	      ORDER BY my_record_w35.data_emissione DESC
	      LIMIT 1;
	
	      /* Cerco Snow Level su w35 */
	      SELECT INTO my_record_snow_level (CASE WHEN w35_data.numeric_value IS NOT NULL THEN
	         (ROUND(w35_data.numeric_value / 100, 0) * 100)
	      ELSE
	         (ROUND(w35_data.numeric_value / 100, 0) * 100)
	      END) AS value, ('Aree_Meteo ' || my_record_w35.data_emissione)::VARCHAR AS source
	      FROM w35_data
	      WHERE w35_data.id_area_meteo = my_record_aree.id_area_meteo
	         AND w35_data.id_time_layouts = my_time_layouts
	         AND w35_data.id_parametro = 'SNOW_LEV'
	         AND w35_data.id_aggregazione = '0'
	         AND w35_data.id_w35=my_record_w35.id_w35
	         AND ( w35_data.numeric_value IS NOT NULL OR w35_data.numeric_value IS NOT NULL )
	      ORDER BY my_record_w35.data_emissione DESC
	      LIMIT 1;
	      
	      /* Per tutti i Comuni associati all'area meteo... */
	      FOR my_record_aree_comune IN
	         (SELECT comune_official.id_comune, comune_official.quota_comune
	         FROM rel_aree_meteo_comune
	            LEFT JOIN comune_official ON rel_aree_meteo_comune.id_comune = comune_official.id_comune
	         WHERE rel_aree_meteo_comune.id_area_meteo = my_record_aree.id_area_meteo)
	      LOOP
	         IF my_record_sky_condition.ignore_refresh_forecast_comuni THEN
	            raise notice 'non eseguo modifiche sull''icona per l''area meteo: "%" id_time_layouts: "%"', my_record_sky_condition.id_area_meteo, my_record_sky_condition.id_time_layouts;
	            UPDATE forecast_comuni SET sky_condition = my_record_sky_condition.value, last_update = current_timestamp WHERE id_comune = my_record_aree_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	         ELSE
	            IF my_record_sky_condition.value = ANY(pioggia_array) THEN
	               /* Siamo in presenza di precipitazioni (neve, pioggia, temporali, ecc.) */
	               
	               SELECT INTO my_record_comune_terma air_temperature
	               FROM forecast_comuni
	               WHERE id_comune = my_record_aree_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	
	               my_sky_condition := NULL;
	               IF my_record_snow_level.value IS NOT NULL  THEN
	                  IF ((my_record_snow_level.value - my_record_aree_comune.quota_comune) <= 100) THEN
	                     /* Se QUOTA_NEVE - ALTEZZA_COMUNE <= 100 m --> NEVE */
	                     CASE my_record_sky_condition.value
	                        WHEN 27 THEN my_sky_condition :=  9; /* Very light rain --> Light snow */
	                        WHEN  8 THEN my_sky_condition :=  9; /* Light rain --> Light snow */
	                        WHEN 17 THEN my_sky_condition := 21; /* Rain --> Snow */
	                        WHEN  6 THEN my_sky_condition :=  7; /* Heavy rain --> Heavy snow */
	                        WHEN 25 THEN my_sky_condition := 29; /* Very heavy rain --> Very heavy snow */
	                        WHEN 18 THEN my_sky_condition :=  9; /* Rain and snow --> Light snow */
	                        WHEN 28 THEN my_sky_condition :=  9; /* Very light snow --> Light snow */
	                        WHEN 30 THEN my_sky_condition := 31; /* Wind and rain --> Wind and snow */
	                        ELSE my_sky_condition := my_record_sky_condition.value::SMALLINT;
	                     END CASE;
	                  END IF;
	                  IF ((my_record_snow_level.value - my_record_aree_comune.quota_comune) > -100) AND ((my_record_snow_level.value - my_record_aree_comune.quota_comune) < 100)  THEN
	                     /* Se QUOTA_NEVE - ALTEZZA_COMUNE > -100 m e QUOTA_NEVE - ALTEZZA_COMUNE < 100 m  --> PIOGGIA e NEVE */
	                     my_sky_condition := 18;
	                  END IF;
	                  IF ((my_record_snow_level.value - my_record_aree_comune.quota_comune) > 100)  THEN
	                     /* Se QUOTA_NEVE - ALTEZZA_COMUNE > 100 m  --> PIOGGIA */
	                     CASE my_record_sky_condition.value
	                        WHEN 28 THEN my_sky_condition :=  8; /* Very light snow --> Light rain */
	                        WHEN  9 THEN my_sky_condition :=  8; /* Light snow --> Light rain */
	                        WHEN 21 THEN my_sky_condition := 17; /* Snow --> Rain */
	                        WHEN  7 THEN my_sky_condition :=  6; /* Heavy snow --> Heavy rain */
	                        WHEN 26 THEN my_sky_condition := 25; /* Very heavy snow --> Very heavy rain */
	                        WHEN 18 THEN my_sky_condition :=  9; /* Rain and snow --> Light rain */
	                        WHEN 27 THEN my_sky_condition :=  9; /* Very light rain --> Light rain */
	                        WHEN 31 THEN my_sky_condition := 30; /* Wind and snow --> Wind and rain */
	                        WHEN  1 THEN my_sky_condition := 30; /* Blizzard --> Wind and rain */
	                        ELSE my_sky_condition := my_record_sky_condition.value::SMALLINT;
	                     END CASE;
	                  END IF;
	               ELSE
	                  my_sky_condition := 12;
	               END IF;
	               UPDATE forecast_comuni SET sky_condition = my_sky_condition, last_update = current_timestamp WHERE id_comune = my_record_aree_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	            ELSE
	               UPDATE forecast_comuni SET sky_condition = my_record_sky_condition.value, last_update = current_timestamp WHERE id_comune = my_record_aree_comune.id_comune AND data_emissione = current_date AND id_time_layouts = my_time_layouts;
	            END IF;
	         END IF;
	      END LOOP;
	   END LOOP;
	
	END LOOP;
	
	UPDATE forecast_comuni SET wind_direction = '-' WHERE wind_class=0;
	
	UPDATE forecast_comuni SET wind_class =2
	WHERE sky_condition in (29,30,31,45,46)
	AND wind_class in (0,1);
	
	UPDATE forecast_comuni SET wind_direction = 'VR'
	WHERE wind_class !=0
	AND wind_direction='-';
ELSE
	RAISE EXCEPTION  'Non c'' il record di oggi! Non faccio nulla';
END IF;
END;
$function$
;

\c
\set command `echo "curl $DATA_LOCATION/w35_last_days.copy"`
COPY w35 FROM PROGRAM :'command' CSV HEADER DELIMITER ',' ;
\set command `echo "curl $DATA_LOCATION/w35_data_last_days.copy"`
COPY w35_data FROM PROGRAM :'command' CSV HEADER;
